import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import "./index.css";
import { BroserRouter } from "react-router-dom";

ReactDOM.render(
  <BroserRouter>
    <App />
  </BroserRouter>,
  document.getElementById("root")
);
